import React from 'react'
import Styles from "./Navbar.module.css";

const Navbar = () => {
  return (
    <div className={Styles.navbar}>
        <div className={Styles.nav1}>

        </div>
        <div className={Styles.nav2}></div>
    </div>
  )
}

export default Navbar
